import React, { Component,ListGroup, } from "react";
import { Col } from "react-bootstrap";
export default function Hasil (){
  
      
    const {keranjangs}=this.props;
     
    return (
      <div>
        <Col md="2" mt="2">
          <h4>
              
            <ListGroup>
                {keranjangs.map((data)=>
                 <ListGroup.Item>{data}</ListGroup.Item>
                )}
            </ListGroup>
          </h4>

          <hr />
        </Col>
      </div>
    );
  }
